from flask import Flask, request, jsonify
from flask_cors import CORS
import numpy as np


def relu(x):
    return np.maximum(0, x)

def softmax(x):
    e_x = np.exp(x - np.max(x))
    return e_x / e_x.sum(axis=0)


def evaluate_image(image, W1, b1, W2, b2):
    x = image.flatten()

    z1 = np.dot(W1.T, x) + b1
    a1 = relu(z1)

    z2 = np.dot(W2.T, a1) + b2
    a2 = softmax(z2)

    return np.argmax(a2)



